    "2016-03-17T07:01:24.380432",nt"name": "campaign-finance-database-a4859",nt"isopen":
    true,nt"url": null,nt"notes": "The campaign finance database is the San
    Francisco Ethics Commission's repository for campaign finance filings. It can answer
    questions about who is contributing money, who is receiving money, and how it is
    being spent. Use the campaign finance database to research campaign contributions
    and expenditures reported on forms provided by the Fair Political Practices Commission.
    The database provides live access to the Ethics Commission's records. Filings are
    accessible once processed/posted by the Ethics Commission.Forms filed with the Ethics
    Commission can be downloaded in PDF format.  Forms filed electronically can be searched
    and exported in Microsoft Excel format.  The following Excel exports are available:-
    Excel file based on a search of itemized transactions up to 2,000 rows (Updated
    immediately, with the exception of FPPC filing deadlines -- within 48 hours);- Excel
    file by year or for entire life of a single committee (Updated immediately upon
    filing submission); and- Excel file by year for all committees in a single calendar
    year (Updated every 24 hours).",nt"license_title": "Other License Specified",nt"extras":
